import React from 'react';
import PropTypes from 'prop-types';
import './AppBar.css' //para manejar su css

AppBar.propTypes = {
    title: PropTypes.string, 
    subtitle: PropTypes
};

function AppBar({title="TITULO", subtitle="Subtitle", ...props}) { //..props: que se jale todos los props que tienen los componentes de react, que le pueden ser utiles
    //props: propiedades nativas del componente que tiene react
    //si no le mandamos los parametros, que utilice los que tiene por default
    return (
        <div className="appbar">
            <h1> {title} </h1>
        
            <h4>{subtitle} </h4>
            </div>    
    );
}

export default AppBar;
